export class Sddiagnostic {
    PatientId: number;
    Anemie?: boolean;
    Splenomegalie?: boolean;
    ComplicationAigue: boolean;
    SpecificationCa?: string;
    EnqueteFamiliale: boolean;
    SpecificationEf?: string;
    AutreComplication: boolean;
    SpecificationAutre?: string;
    Age: number; 
    Poids?: number; 
    Taille?: number; 
    Ictere?: boolean;
    SplenomegalieCourant?: boolean;
    Hemoglobine: number;
    Reticulocyte: number;
    NbrGlobulesBlancs: number;
    TauxPlaquette: number;
    Ferritine: number;
    ElectrophoreseAvantPremiereTransfusion: boolean;
    HbHbA?: number;
    HbA2?: number;
    HbF?: number; 
    HbS?: number; 
    AutreHb?: string;

    constructor() {
        this.PatientId = 0;
        this.ComplicationAigue = false;
        this.EnqueteFamiliale = false;
        this.AutreComplication = false;
        this.Age = 0;
        this.Hemoglobine = 0;
        this.Reticulocyte = 0;
        this.NbrGlobulesBlancs = 0;
        this.TauxPlaquette = 0;
        this.Ferritine = 0;
        this.ElectrophoreseAvantPremiereTransfusion = false;
        this.Anemie=false;
        this.Splenomegalie=false;
        this.SpecificationCa='';
        this.EnqueteFamiliale=false;
        this.SpecificationEf='';
        this.SpecificationAutre='';
        this.Poids=0;
        this.Taille=0; 
        this.Ictere=false;
        this.SplenomegalieCourant=false;
        this.ElectrophoreseAvantPremiereTransfusion=false;
        this.HbHbA=0;
        this.HbA2=0;
        this.HbF=0; 
        this.HbS=0; 
        this.AutreHb='';
    }
}
